import React from 'react';
import Todos from './components/Todos';

class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Dinner with wife',
        completed: false
      },
      {
        id: 3,
        title: 'Meeting with friends',
        completed: false
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>Hello World!</h1>
        <Todos />
      </div>
    );
  }
}

export default App;
